function trie_add(root, str, value) {
  if (str === '$') throw new Error('Invalid special symbol; $');
  return _trie_add(root, str, value, 0, str.length);
}

function _trie_add(branch, str, value, index, len) {
  if (index >= len) return branch.$ = value;
  let c = str.charCodeAt(index);
  let o = branch[c];
  if (!branch[c]) {
    o = {};
    branch[c] = o;
  }
  return _trie_add(o, str, value, index+1, len);
}

function trie_get(root, str) {
  if (str === '$') throw new Error('Invalid special symbol; $');
  return _trie_get(root, str, 0, str.length);
}
function _trie_get(branch, str, index, len) {
  if (index >= len) return branch.$;
  let c = str.charCodeAt(index);
  let o = branch[c];
  if (!o) return undefined;
  return _trie_get(o, str, index+1, len);
}
